import React from 'react'
import {NavLink} from 'react-router-dom';

const SignedOutLinks = () => {
    return(
        <ul className="right">
            <li><NavLink to="/">Singup</NavLink></li>
            <li><NavLink to="/">Login</NavLink></li>
        </ul>
    )
}
export default SignedOutLinks;
